function fakeJobList(count) {
    const list = [];
    for (let i = 0; i < count; i += 1) {
        list.push({
            id: uuid.v4(),
            status: Random.jobStatus(),
            type: Random.jobType(),
            name: Random.word(),
            start_time: new Date().getTime() / 1000,
        })
    }
    return list;
}

